import React, { Component } from 'react'
import Navbar from './Navbar';
import Button from './Button';
import './App.css';

export default class App extends Component {

  constructor(props) {
    super(props)

    this.state = {
       isPickup: true
    }
  }

  render() {
    return (
      <div>
         <Navbar/>
        <h1 className="heading">Maria's Pizza</h1>
        <Button/>
        {this.state.isPickup}
      </div>
    )
  }
}
